import React, { useState, useEffect } from 'react';

const DisplayData = () => {
  const [data, setData] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await fetch('/process_data.php?api=apache-logs');
        const jsonData = await response.json();
        setData(jsonData);
      } catch (error) {
        console.error('Error fetching data:', error);
      }
    };

    fetchData();
  }, []);

  return (
    <div>
      <table>
        <thead>
          <tr>
            <th>ID</th>
            <th>IP</th>
            <th>DateTime</th>
            <th>RequestMethod</th>
            <th>URL</th>
            <th>Protocol</th>
            <th>StatusCode</th>
            <th>ResponseSize</th>
            <th>UserAgent</th>
          </tr>
        </thead>
        <tbody>
          {data.map((item) => (
            <tr key={item.id}>
              <td>{item.id}</td>
              <td>{item.ip}</td>
              <td>{item.datetime}</td>
              <td>{item.request_method}</td>
              <td>{item.url}</td>
              <td>{item.protocol}</td>
              <td>{item.status_code}</td>
              <td>{item.response_size}</td>
              <td>{item.user_agent}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default DisplayData;
